import React from "react";
import Header from "./components/shared/Header";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Home from "./components/Home";
import DrinkIndex from "./components/views/drink/DrinkIndex";
import DrinksDetails from "./components/views/drink/DrinksDetails";
import DrinkCreate from "./components/views/drink/DrinkCreate";

const App = () => (
    <Router>
        <Header></Header>
        <Route exact path="/">
            <Home />
        </Route>
        <Route path="/drinks">
            <DrinkIndex />
        </Route>
        <Route path="/drinks/:id">
            <DrinksDetails />
        </Route>
        <Route path="/drinks/create">
            <DrinkCreate />
        </Route>
    </Router>
);

export default App;
